(67, 65, 114, 'Respetados señores. Gracias por contar con nosotros, por medio de la presente, me permito realizar la siguiente cotización, consistente en el alquiler, instalación de equipos y puesta en funcionamiento de los equipos necesarios para dar cubrimiento vía radio VHF dentro de los túneles.', 'Aspectos para tener en cuenta:\n- *1.*	Como somos conscientes de que su empresa utilizara estos medios de comunicación solo durante el tiempo de construcción de los túneles, nos permitimos realizar la cotización en alquiler de los equipos.-\n-  *A.* 	      La  opción consiste en un sistema análogo, el cual transmite y se enlaza a través de RF en donde no se involucra cable radiante y consiste básicamente en amplificadores de señal los cuales se van encargando de ir amplificando la señal de radio en VHF y se tendría un canal para cada túnel-\n-*2.*	Tener en cuenta que en la instalación de los sunchos o pernos para instalar los equipos o cables, se instalara por parte de su empresa con apoyo de nuestro personal, esto debido a que su empresa tiene las herramientas y el personal calificado para dicha labor-\n-*3.*	Se debe de garantizar en los sitios en donde van los amplificadores de señal un lugar con energía 110 AC al igual que el espacio para los racks y las antenas.-', '45 días', '24 meses', '30 días', '20 días habiles', NULL, 'El mantenimiento preventivo y correctivo cada vez que se requiera esta incluido, lo que no incluyen son daños ocasionados a los equipos por mal manejo de estos una vez instalados', NULL, 0, 0, NULL, 6, '2023-05-30 14:53:53'),
