(74, 72, 26, 'Respetados señores. Atendiendo su amable solicitud y conociendo la necesidad que tienen actualmente con respecto a la comunicación vía radio, me permito realizar la siguiente oferta. \nAspectos importantes para tener en cuenta:\n- *1.* Como es de su conocimiento nuestra empresa lleva trabajando en la zona alrededor de 6 años, haciendo presencia en el sector y teniendo confidencialidad y secreto respecto a la ubicación de los cerros que nos dan cubrimiento en la zona vía radio.\n- *2.* Nuestra repetidoras pueden ser programados con los grupos que actualmente estan trabajando quedando la opción de poder unir todos los grupos y generar canales de emergencia\n- *3.* Siempre nos hemos caracterizados por nuestro buen desempeño y en atender los requerimientos en tiempo mínimo para no afectar sus comunicaciones además nuestra tiempo en el mercado de mas de 20 años nos hace tener la suficiente experiencia para asumir los retos que se nos puedan presentar \n- *4.* Los radios que nos permitimos cotizar son modelos que cumplen normas militares de encriptación, con varias opciones tales como con teclado o  sin teclado, el teclado permite editar mensajes de texto, todos los radios tienen GPS para permitir la ubicación en caso de una emergencia y todos cuentan con un botón de pánico al igual que nos permiten inhabilitar el equipo en caso de caer en personal ajeno o hurto.\n- *5.* Debido al alto flujo de radios que necesitan, nos permitimos cotizar de igual manera una repetidora en alquiler, la cual podría ser programada con la que actualmente tienen alquilada con nuestra empresa igual les recuerdo en caso de que necesiten comunicación en la vía hasta Medellín y tener comunicación instantánea con alguna oficina en Medellín, podríamos cotizar igual este servicio. Igual se pueden realizar enlaces por IP en caso de necesitar en otra ciudad o cualquier lugar del mundo.\n- *6.* Es de aclarar que la repetidora digital, permite dos comunicaciones simultaneas ya que cuenta con dos slot pero si van a utilizar datos como GPS, se debe de dejar un Slot disponible para los datos de GPS.\n\n*Nota importante: los precios de los equipos en venta estan en dolares*', 'Venta: Radios Portátiles completos con todos sus accesorios como son antena batería y cargador\nALQUILER:Todos los gastos asociados al buen funcionamiento de los equipos alquilados', '8 dias', NULL, '30 Dias', '20 Días Después De Recibida Orden De Compra (Según Existencia)', NULL, 'Equipos en venta dos años de garantia', 'Los equipos pueden se entregados en el área metropolitana sin costo alguno, si hay que enviarlo a otro lugar ,su empresa debe asumir el costo', 1, 2, NULL, 39, '2023-06-06 16:06:02'),
