(27, NULL, 15, 3, 1, 1, 3, '2860000', '0', '0', 0, 0, 'Radio digital viene con gps, compacto y resistente, que cumple con el estándar DMR. Su diseño compacto lo hace convenientemente portátil, con una antena corta y eficiente que no le molestará en absoluto. Ha sido probado de conformidad con los estándares militares para niveles de resistencia extrema y cuenta con certificación IP68 para protección casi total contra polvo y agua. No le fallará ni siquiera en los entornos más hostiles.', 39, '2023-02-01 12:07:34'),
(28, NULL, 6, 3, 1, 1, 3, '3340000', '0', '0', 0, 0, 'El radio DGP8550e viene con GPS, con pantalla y es versátil, potente. MOTOTRBO combina lo mejor de la funcionalidad de radio de dos vías con los últimos avances en tecnología digital.', 39, '2023-02-01 12:07:34'),
(29, NULL, 16, 3, 1, 1, 3, '1700000', '0', '0', 0, 0, 'Simple y asequible, el radio portátil de dos vías DEP 450 es un radio Digital para los usuarios que lo utilizan todos los días y desean permanecer conectados. Totalmente compatible con la familia de radios MOTOTRBO™, el DEP 450 tiene una calidad de audio superior, una cobertura sobresaliente, una batería de larga duración y mucho más. Sin GPS', 39, '2023-02-01 12:07:34'),
(30, NULL, 17, 3, 1, 1, 3, '972000', '0', '0', 0, 0, 'fácil de usar y de actualizar con los sistemas analógicos existentes. Si su empresa está considerando migrar a un sistema digital, estos nuevos radios digitales son compatibles con los modos analógico y digital. La compatibilidad de los accesorios garantiza que pueda seguir utilizando las baterías, antenas y cargadores que ha comprado, lo que protege aún más su inversión. Sin GPS', 39, '2023-02-01 12:07:34'),
