(139, NULL, 17, 14, 1, 1, 3, '945000', '0', '0', 0, 0, 'El DEP 250 es un radio de 16 canales, sin teclado ni pantalla. Está equipado con funcionalidades fáciles de usar. La posibilidad de operarlo tanto en modo analógico como digital también facilita y hace más rentable adaptar los nuevos radios digitales a los radios analógicos con los que ya cuenta y hacer que funcionen conjuntamente sin problemas. Además, puede migrar a una plataforma de radio de dos vías digital a su ritmo. Características principales  Comunicaciones de voz analógicas/digitales, Anuncio de voz , Modo directo de capacidad dual, Mensajería de texto preprogramada ,Transmit Interrupt (decodificación únicamente), Cumple con los estándares de Radio Móvil Digital (DMR) 1', 39, '2023-02-13 15:33:39'),
(241, NULL, 149, 16, 1, 80, 3, '1740000', '19', '0', 0, 0, 'Venta de radio PoC PNC550  integra teléfono inteligente con funciones de PTT sobre celular. Pantalla multitáctil de 5 pulgadas, Vida prolongada de la batería y carga rápida PTT dedicado y botón de alarma, Sistema Android, Calidad de voz fuerte y clara, Cámara HD de 13 MP Diseño robusto y compacto Dual SIM', 39, '2023-02-15 16:08:11'),
(242, NULL, 150, 16, 1, 80, 3, '865000', '0', '0', 0, 0, 'Venta de Radio PoC PNC380 es un dispositivo pulsar para hablar sobre celular que combina las comunicaciones instantáneas y las aplicaciones multimedia en un único dispositivo. Capaz de operar sobre redes 2G, 3G, 4G y Wi-Fi, este PoC le ofrece servicios ricos en datos como transmisión de datos y video 4G, compartición de localización y mensajería instantánea.', 39, '2023-02-15 16:08:11'),
