(483, NULL, 193, 22, 1, 1, 3, '9996000', '19', '0', 0, 0, 'Sistema de monitoreo y grabación de voz Hytera SmartOne, una plataforma de comunicaciones unificadas de última generación,\nlogra la intercomunicación entre varios sistemas y el envío unificado para brindar\na nuestros clientes comunicaciones ilimitadas.\nEl objetivo de Hytera SmartOne es lograr la comunicación entre usuarios de radio,\ndistribuidores y usuarios de red pública a través de la interconexión de redes en\ncualquier momento y en cualquier lugar.\nEl potente cliente de envío permite que los administradores y distribuidores controlen\ncon rapidez a todos los usuarios de distintas redes.\nY, tan importante como todo esto, Hytera SmartOne ofrece una interfaz API unificada\npara que los integradores desarrollen aplicaciones más flexibles y personalizadas para\nusuarios finales.\nIncluye:\n1 consola\n1 servidor\n1 gateway\n25 licencias para radios suscriptores', 39, '2023-03-09 17:28:19'),
(484, NULL, 186, 22, 1, 2, 3, '3160000', '19', '0', 0, 0, '*Estos dos radios van asociados al sistema de monitoreo de hytera Smart One*, Diseño orientado al usuario La pantalla a color de gran tamaño permite una buena visibilidad incluso bajo una luz extremadamente fuerte. Además, las siete teclas programables facilitan la comunicación en distintas condiciones.\nVoz superior Con la aplicación combinada del códec de banda estrecha y la tecnología digital de corrección de errores, MD786/786G puede garantizar una voz superior en ambientes ruidosos o en el límite del área de cobertura. \nServicios versátiles Además de los servicios de comunicación convencionales, MD786/786G incluye servicios de datos enriquecidos y funciones seleccionables como Mensaje de texto, Escaneo, Emergencia, Dirección de canal, Registro automático y Trabajador individual. Garantia 3 años', 39, '2023-03-09 17:28:19'),
(485, NULL, 188, 22, 1, 1, 3, '3160000', '19', '0', 0, 0, 'Diseño orientado al usuario La pantalla a color de gran tamaño permite una buena visibilidad incluso bajo una luz extremadamente fuerte. Además, las siete teclas programables facilitan la comunicación en distintas condiciones.\nVoz superior Con la aplicación combinada del códec de banda estrecha y la tecnología digital de corrección de errores, MD786/786G puede garantizar una voz superior en ambientes ruidosos o en el límite del área de cobertura. \nServicios versátiles Además de los servicios de comunicación convencionales, MD786/786G incluye servicios de datos enriquecidos y funciones seleccionables como Mensaje de texto, Escaneo, Emergencia, Dirección de canal, Registro automático y Trabajador individual. Garantia 3 años', 39, '2023-03-09 17:28:19'),
(486, NULL, 162, 22, 1, 21, 3, '1870000', '19', '0', 0, 0, 'El radio PD786 se diseñó bajo el estándar abierto DMR el cual posee múltiples características, tanto para comunicaciones de voz como de datos. Su diseño cuenta con certificaciones IP67 y STD-MIL 810. El Pseudotrunking patentado por Hytera maximiza el uso del canal. Las características clave como vibración, un botón de emergencia y la gran pantalla a color hace de esta una solución ideal para las comunicaciones de misión crítica. El PD786G viene equipado con GPS (Opcional) que permite que el radio se pueda integrar con sistemas de despacho de Hytera u otros desarrollados por terceros. Garantia 3 años', 39, '2023-03-09 17:28:19'),
