(563, NULL, 226, 39, 1, 9, 3, '1170000', '19', '0', 0, 0, 'Los radios de serie DTR de Motorola ahora son más confiables que nunca. Permiten establecer comunicaciones privadas sin interferencias para ayudar a su equipo a mantenerse concentrado garantizando la privacidad de sus comunicaciones.\nCon un diseño delgado y resistente, el radio digital de dos vías DTR 720 cuenta con certificación IP54 y funciona en 900 MHz. Pantalla color completa en gráficos y menú de navegación intuitiva que ayuda a ubicar rápidamente todas las funciones del radio.  El DTR720 ofrece opciones de comunicación flexibles, incluidas «llamada digital uno a uno» y «llamada digital uno a varios». El DTR720 también ofrece un excelente nivel de cobertura, batería de larga duración y calidad de audio digital; es decir, audio fuerte y claro dondequiera que se encuentre.', 39, '2023-03-30 17:15:36'),
