(804, NULL, 66, 53, 1, 40, 3, '590000', '19', '0', 0, 0, 'El radio TK-3000 en uhf es fácil de manejar y de operar, 16 Canales.,Password de datos de escritura y sobreescritura, Envío de PTT ID con DTMF, 5 Watts en VHF y 4 Watts en UHF, Exploración de canales (SCAN) normal y prioritario, VOX para uso de manos libres, Anchos de canal 12.5 kHz o 25 kHz,1 Tecla Programable, tonos CTCSS y DCS, temporizador de transmisión (TOT), Candado de canal ocupado, alerta de batería baja, ahorrador de batería, lED indicador de tres colores, envío de códigos DTMF, Cloneo (radio a radio con cable),\ntalk around, modo de ajuste por software, Certificación ISO 9000', 39, '2023-04-25 17:23:46'),
(805, NULL, 298, 53, 1, 40, 3, '325000', '19', '0', 0, 0, 'El radio TC-320 en uhf es una de esas grandes soluciones tecnológicas a problemas cotidianos. Este radio PMR446 no requiere licencia y ofrece muchas funciones con un precio óptimo para negocios pequeños. Con un destacado diseño compacto y ergonómico, el TC-320 ofrece una excelente calidad de sonido y resistencia contra impactos, ideal para entornos comerciales y negocios rentables.', 39, '2023-04-25 17:23:46'),
(806, NULL, 299, 53, 1, 40, 3, '145000', '19', '0', 0, 0, 'El T470 es resistente a la intemperie y soporta todo tipo de entornos hostiles. Linterna LED integrada que le permite llegar adonde necesite aun en plena oscuridad, Con un rango de hasta 35 millas, 20 tonos de llamada, No es necesario registrarlo. Puede utilizarlo inmediatamente y comenzar a explorar sin complicaciones. El alcance indicado para las comunicaciones se calcula en condiciones óptimas, con línea de vista libre.  Su alcance real estará limitado por varios factores, incluidos, aunque sin carácter restrictivo, el terreno, las condiciones climáticas.', 39, '2023-04-25 17:23:46'),
(807, NULL, 300, 53, 1, 40, 3, '290000', '19', '0', 0, 0, 'El radio XT185 es elegante y discreto y le permite colaborar con otros. Con diseño resistente a la intemperie IP54 y tamaño de bolsillo, lo puede llevar con usted a cualquier lugar. No requiere licencia e incluye funciones clave tales como lectura, carga USB, 22 canales y batería de hasta 24 horas de autonomía,  Con 22 canales y 121 códigos de privacidad, Clasificación IP54.', 39, '2023-04-25 17:23:46'),
