(837, NULL, 303, 55, 1, 1, 4, '2036160', '19', '0', 0, 0, '*MANTENIMIENTO PREVENTIVO TRIMESTRAL* Durante el año se realizará 4 mantenimientos y se cobran una vez se realice, donde realizaremos:  Revisión de los equipos que conforman la red de radio junto con sus accesorios, energía, cableados, con el fin de garantizar la continuidad y buen funcionamiento de las comunicaciones de voz.  Programación de radios.  Limpieza, revisión de contactos, medición de parámetros de potencia y voltajes, revisión objetiva de sus componentes., Análisis de baterías tanto en los cerros como las baterías de los radios portátiles con el fin de tener un estimado de reemplazo de las mismas antes de que empiecen a fallar, Realización de una hoja de vida por cada uno de los elementos de la red, con el fin de mirar el récord de los mismos y hacer seguimientos.  En caso de falla sobre cualquier equipo o componente de acuerdo al diagnóstico se deberá informar el costo de la reparación y este solo se podrá realizar previa autorización. Revisión de los equipos que conforman los enlaces de transmisión de datos incluida la revisión de los equipos que se encuentran en las torres junto con sus accesorios, energía, cableados, con el fin de garantizar la continuidad y buen funcionamiento del sistema de transmisión.', 39, '2023-04-27 11:19:22'),
