(1117, NULL, 23, 69, 1, 9, 3, '1040000', '19', '0', 0, 0, 'El DEP 250 es un radio de 16 canales, sin teclado ni pantalla. Está equipado con funcionalidades fáciles de\nusar. La posibilidad de operarlo tanto en modo analógico como digital también facilita y hace más rentable\nadaptar los nuevos radios digitales a los radios analógicos con los que ya cuenta y hacer que funcionen\nconjuntamente sin problemas. Además, puede migrar a una plataforma de radio de dos vías digital a su ritmo.\nCaracterísticas principales Comunicaciones de voz analógicas/digitales, Anuncio de voz , Modo directo de\ncapacidad dual, Mensajería de texto preprogramada ,Transmit Interrupt (decodificación únicamente), Cumple\ncon los estándares de Radio Móvil Digital (DMR) 1', 39, '2023-06-01 17:25:58'),
(1118, NULL, 22, 69, 1, 9, 3, '1590000', '19', '0', 0, 0, 'Simple y asequible, el radio digital portátil de dos vías DEP 450 es un radio para los usuarios que lo utilizan todos los días y desean permanecer conectados. Totalmente compatible con la familia de radios MOTOTRBO™, el DEP 450 tiene una calidad de audio superior, una cobertura sobresaliente, una batería de larga duración, operan en sistemas IP Site Connect y cuenta con 32 canales.', 39, '2023-06-01 17:25:58'),
(1120, NULL, 15, 70, 1, 1, 3, '3300000', '19', '0', 0, 0, 'Increíblemente compacto y excepcionalmente resistente, el radio de dos vías portátil MOTOTRBO™ DGP 8050 Elite es la solución perfecta para el profesional en movimiento. Este radio pequeño, pero poderoso lo mantiene en contacto con sus empleados sin sobrecargarlo. Brinda con todos los beneficios de la última tecnología digital: excelente calidad de audio, sorprendente claridad, cobertura sobresaliente, batería de gran duración ,Como parte de la familia MOTOTRBO de Motorola, el DGP 8050 Elite ofrece la mejor tecnología de radio digital. Al equipar a sus trabajadores con voz y datos integrados, el DGP 8050 Elite les permite compartir información de manera inalámbrica e instantánea entre los dispositivos. El GPS integrado permite hacer un seguimiento de la ubicación de los equipos de trabajo móviles, lo que ayuda a mejorar la seguridad y eficacia operacional del personal. Este radio no le teme al polvo, la suciedad o el agua; se sobrepone a las condiciones más extremas e inhóspitas con una durabilidad excepcional.', 39, '2023-06-01 21:13:46'),
(1126, NULL, 67, 72, 1, 5, 3, '600000', '19', '0', 0, 0, 'El radio TK-3000 es fácil de manejar y de operar, 16 Canales.,Password de datos de escritura y sobreescritura,\nEnvío de PTT ID con DTMF, 5 Watts en VHF y 4 Watts en UHF, Exploración de canales (SCAN) normal y\nprioritario, VOX para uso de manos libres, Anchos de canal 12.5 kHz o 25 kHz,1 Tecla Programable, tonos CTCSS y DCS, temporizador de transmisión (TOT), Candado de canal ocupado, alerta de batería baja, ahorrador de batería, lED indicador de tres colores, envío de códigos DTMF, Cloneo (radio a radio con cable),\ntalk around, modo de ajuste por software, Certificación ISO 9000', 39, '2023-06-02 09:51:21'),
