(1378, NULL, 473, 74, 2, 80, 3, '330', '19', '0', 0, 0, 'Logre todas las ventajas de la radio digital con el PD706 de Hytera, una solución digital popular y versátil que ofrece una amplia gama de funciones con la mejor calidad de audio. Construido con los más altos estándares de calidad, permite comunicaciones confiables y seguras en cualquier situación.', 39, '2023-06-07 16:47:01'),
(1379, 'Opcion Nº 2 Radio Hytera PD786G', NULL, 74, NULL, NULL, NULL, NULL, '0', '0', 0, 0, NULL, 39, '2023-06-07 16:47:01'),
(1380, NULL, 253, 74, 1, 80, 3, '450', '19', '0', 0, 0, 'El radio de comunicación portátil PD786 de Hytera con teclado completo, ofrece una amplia gama de funciones y una alta calidad que asegura su comunicación ininterrumpida en cualquier circunstancia\nEl radio PD786 se diseñó bajo el estándar abierto DMR el cual posee múltiples características, tanto para comunicaciones de voz como de datos. Su diseño cuenta con certificaciones IP67 y STD-MIL 810.. Las características clave como vibración, un botón de emergencia y la gran pantalla a color hace de esta una solución ideal para las comunicaciones de misión crítica. El PD786G viene equipado con GPS (Opcional) que permite que el radio se pueda integrar con sistemas de despacho de Hytera u otros desarrollados por terceros.', 39, '2023-06-07 16:47:01'),
(1381, 'Opcion Nº 3 Radio Hytera HP706G', NULL, 74, NULL, NULL, NULL, NULL, '0', '0', 0, 0, NULL, 39, '2023-06-07 16:47:01'),
(1382, NULL, 472, 74, 2, 80, 3, '530', '19', '0', 0, 0, 'La radio digital HP706 es el resultado de recopilar y analizar las ideas y aportes de usuarios de todos los sectores.\nEste radio portátil provee una experiencia más eficiente y confiable gracias a un nivel de audio alto y preciso, una batería de mayor duración, una interfaz de audio intuitiva, su portabilidad notable y su gran resistencia.', 39, '2023-06-07 16:47:01'),
(1383, 'Opcion Nº 4 Radio Hytera HP786G', NULL, 74, NULL, NULL, NULL, NULL, '0', '0', 0, 0, NULL, 39, '2023-06-07 16:47:01'),
(1384, NULL, 468, 74, 2, 80, 3, '720', '19', '0', 0, 0, 'Radio digital HP786G es el resultado de la innovación y una amplia experiencia fabricando equipos de radiocomunicación para distintos sectores. Ofrece una serie de beneficios a la productividad y seguridad del usuario. Garantiza un audio nítido sin ruido, una batería mejorada, una interfaz intuitiva y un diseño robusto y compacto.\nGPS- BLUETOOTH-MD Radio con pantalla, canales 1024, numero de zonal 64', 39, '2023-06-07 16:47:01'),
(1385, 'Opcion Nº 4 Radio Motorola R7', NULL, 74, NULL, NULL, NULL, NULL, '0', '0', 0, 0, NULL, 39, '2023-06-07 16:47:01'),
(1386, NULL, 469, 74, 2, 80, 3, '930', '19', '0', 0, 0, 'RADIO PORTÁTIL R7™\nEs una radio digital de dos vías que ofrece capacidades de audio revolucionarias en un dispositivo robusto y a prueba del futuro. Su procesamiento de audio avanzado garantiza que sus comunicaciones sean fuertes y claras, mientras que su construcción robusta está preparada para entornos hostiles, y las opciones avanzadas de conectividad preparan a su personal para el futuro. Capacidades Fuerte y claro: Proporcionando un nivel superior de cancelación de ruido, volumen y claridad, el MOTOTRBO R7, se destaca en casos en que las comunicaciones de audio sean un reto, para que su equipo pueda escuchar y ser escuchado en cualquier lugar en el que opere, incluso en los entornos más ruidosos., MOTOTRBO R7 ha sido diseñado para empresas y probado para resistir los entornos más difíciles. Pantalla de 2.4 pulgadas,320 x 240 px, micrófonos delanteros y traseros para una cancelación de ruido avanzada, altavoz frontal detrás del teclado, y batería delgada de larga duración. Con GPS', 39, '2023-06-07 16:47:01'),
