(1422, NULL, 201, 83, 1, 1, 3, '3550000', '19', '0', 0, 0, 'En la serie DGP 4150 puedes enviar en caso de emergencia las coordenadas de tu posición al operador del sistema. Esta serie de radios digitales ofrecen una solución integral de voz y datos, soportando ilimitadas aplicaciones. En la actualidad se ofrecen las aplicaciones de mensajes de datos y la localización GPS. Permite aplicaciones de datos incluyendo Servicios de mensajes de texto MOTOTRBO y Servicios de localización MOTOTRBO. Ofrece comunicaciones de voz más nítidas en un rango más amplio de cobertura comparado con radios analógicos similares. Botón de emergencia para alertar al supervisor o despachador en una situación de emergencia', 39, '2023-06-26 08:37:50'),
