(1513, NULL, 228, 94, 1, 2, 3, '1230000', '19', '0', 0, 0, 'Los radios de serie DTR de Motorola ahora son más confiables que nunca. Permiten establecer comunicaciones privadas sin interferencias para ayudar a su equipo a mantenerse concentrado garantizando la privacidad de sus comunicaciones. Con un diseño delgado y resistente, el radio digital de dos vías DTR 720 cuenta con certificación IP54 y funciona en 900 MHz. Pantalla color completa en gráficos y menú de navegación intuitiva que ayuda a ubicar rápidamente todas las funciones del radio. El DTR720 ofrece opciones\nde comunicación flexibles, incluidas «llamada digital uno a uno» y «llamada digital uno a varios». El DTR720 también ofrece un excelente nivel de cobertura, batería de larga duración y calidad de audio digital; es decir, audio fuerte y claro dondequiera que se encuentre', 39, '2023-07-10 10:11:56'),
(1514, NULL, 3, 94, 1, 6, 3, '713000', '19', '0', 0, 0, 'Los radios RVA50 facilitan su trabajo. Un potente altavoz garantiza la claridad de las comunicaciones, aún en entornos ruidosos. Compacto, aunque con un excelente desempeño, el RVA50 ofrece una cobertura para un área total de hasta 23.225 m2 ó 20 pisos', 39, '2023-07-10 10:11:56'),
