(1537, NULL, 303, 93, 1, 4, 1, '1944000', '19', '0', 0, 0, 'MANTENIMIENTO PREVENTIVO TRIMESTRAL Durante el año se realizará 4 mantenimientos y se cobran una vez se realice, donde realizaremos: Revisión de los equipos que conforman la red de radio junto con sus accesorios, energía, cableados, con el fin de garantizar la continuidad y buen funcionamiento de las comunicaciones de voz. Programación de radios. Limpieza, revisión de contactos, medición de parámetros de potencia y voltajes, revisión objetiva de sus componentes., Análisis de baterías tanto en los cerros como las\nbaterías de los radios portátiles con el fin de tener un estimado de reemplazo de las mismas antes de que empiecen a fallar, Realización de una hoja de vida por cada uno de los elementos de la red, con el fin de mirar el récord de los mismos y hacer seguimientos. En caso de falla sobre cualquier equipo o componente de acuerdo al diagnóstico se deberá informar el costo de la reparación y este solo se podrá realizar previa autorización. Revisión de los equipos que conforman los enlaces de transmisión de datos incluida la revisión de los equipos que se encuentran en las torres junto con sus accesorios, energía, cableados, con el fin de garantizar la continuidad y buen funcionamiento del sistema de transmisión.', 39, '2023-07-12 11:10:32'),
(1552, NULL, 450, 96, 1, 1, 4, '180000', '19', '0', 0, 0, 'Servicio de visita técnica, mantenimiento en la central de monitoreo que incluye: \n•	Medición de transición y recepción de radio base\n•	Medición de potencia de salida y potencia reflejada de la antena \n•	Revisión del cableado y accesorios del equipo\n*Nota importante:* los accesorios o cables que en el servicio se identifique para cambio será cargados a la factura, el cambio  se realizara en el momento del servicio, para dejar las comunicaciones en óptimas condiciones', 39, '2023-07-17 07:50:59'),
