(1677, NULL, 526, 113, 1, 1, 4, '100', '19', '0', 1, 0, 'Soporte técnico especializado con disponibilidad constante para la atención del contrato de bomberos en la ciudad de Medellín que incluye \n\n1.	Disponibilidad de personal para atención de cualquier emergencia de la red de radios como son:\n\n•	Dos Sitios de repetición en el sector de monte Alvernia y Padre Amaya\n•	Un sitio de cabecera de enlaces microondas de internet de fibra de Tigo en el sector de Santa Helena \n•	Atención novedades en los radios del cuerpo de bomberos\n\n2.	Reparacion De radios Portátiles y móviles: se realizará un diagnóstico técnico y se enviará una cotizacion con el valor del mantenimiento y repuestos necesarios para su optimo funcionamiento, el cual estará sujeta aprobación y se facturar aparte de este servicio. Antes de entregar los equipos reparados, llevamos a cabo pruebas rigurosas para verificar su funcionalidad y rendimiento en condiciones reales.\n\n*Nota importante: * para estos eventos incluimos transporte de nuestro personal. \nEl servicio se clasificará de la siguiente manera:\n•	*Urgente: * se clasifica cuando el usuario se queda sin comunicación, para esto nos comprometemos a dar respuesta el mismo día \n•	*Arreglo correctivo: * daremos respuesta en el transcurso de una semana para esto hay que aclarar que nosotros suministramos mano de obra, si es necesario cambiar algún elemento depende de Proexcom la autorizacion o hacer llegar los elementos a cambiar.\n\nAsesoramiento Técnico: Nuestro equipo de expertos está disponible para proporcionarle asesoramiento técnico y recomendaciones para optimizar el rendimiento y la durabilidad de los equipos de comunicación y antenas.\nCompromiso con la Calidad: Estamos comprometidos en brindarle un servicio de alta calidad y satisfacer sus necesidades de comunicación y conectividad.', 39, '2023-08-08 12:39:56'),
(1681, NULL, 22, 114, 1, 2, 3, '1470000', '19', '0', 0, 0, 'Simple y asequible, el radio digital portátil de dos vías DEP 450 es un radio para los usuarios que lo utilizan\ntodos los días y desean permanecer conectados. Totalmente compatible con la familia de radios MOTOTRBO™, el DEP 450 tiene una calidad de audio superior, una cobertura sobresaliente, una batería de larga duración, operan en sistemas IP Site Connect y cuenta con 32 canales.', 39, '2023-08-15 10:46:19'),
