(1717, NULL, 527, 117, 1, 1, 3, '2188000', '19', '0', 0, 0, 'impresora portátil Combinando la mejor en tecnología de impresión siendo líder en la industria del etiquetado y capacidades de software, teniendo una Resolución de impresión de 360 dpi, Cortadora automática de medio corte o completo, Velocidad de impresión rápida, 1.4”/s, Etiquetas de hasta 1.5” de ancho, Imprime etiquetas pre-cortadas y continuas, Conectividad USB, Imprime desde el Easy-Mark Plus™, Accesorio de soporte magnético, Paquete de batería recargable\nLa impresora incluye: \n\n1 x Impresora MP300\n1 x Cassette de etiquetas autolaminable S100X150VAM\n1 x Estuche rígido de transporte\n1 x Paquete de baterías recargables de Li-Ion,\n1 x Accesorios magnéticos\n1 x Cable USB\n1 x Cable de Alimentación Vca', 39, '2023-08-24 09:53:46'),
