(1780, NULL, 526, 132, 1, 1, 4, '900000', '19', '0', 0, 0, 'Visita técnica para la desinstalación en vehículos  de 3 radios móviles y posteriormente instalación a 3 vehículos diferentes.', 39, '2023-09-06 12:08:46'),
(1784, NULL, 181, 133, 1, 1, 4, '18000000', '19', '0', 0, 0, 'Servicio de visita técnica,  en plataforma para el estudio de los objetivos y necesidades del proyecto de enlaces microondas donde podemos determinar \n1.	Visita y conocimiento del sitio\n2.	Definición de coordenadas para así aclara distancia a cubrir\n3.	Definición de Capacidad requerida (ancho de banda, velocidad etc.)\n4.	Tipo de comunicación necesario\n5.	Selección de posible ubicación de torres, alturas de ubicación en otros factores', 6, '2023-09-06 14:45:00'),
(1789, NULL, 198, 134, 1, 5, 1, '45000', '19', '0', 0, 0, 'Alquiler Radio portátil por 8 días, radio de comunicación portátil con teclado completo (Antena batería cargador) ofrece una amplia gama de funciones y una alta calidad que asegura su comunicación interrumpida en cualquier circunstancia, este radio viene programado punto a punto con un alcance máximo de 1 km dependiendo de la topografía NOTA IMPORTANTE: estos radios se alquilan y queda bajo su responsabilidad de devolución en las mismas condiciones en el que se entrega, cualquier daño o perdida será cargado a su nombre y se responsabiliza en su valor comercial', 39, '2023-09-07 07:51:10'),
(1790, NULL, 515, 134, 1, 3, 1, '30000', '19', '0', 0, 0, 'Bateria adicional', 39, '2023-09-07 07:51:10'),
(1821, NULL, 25, 135, 1, 159, 3, '647000', '19', '0', 0, 0, 'Incluye la tecnología digital para cancelación de ruidos a fin de obtener una calidad de audio superior incluso en entornos con mucho ruido. La capacidad de intervalo de tiempo doble mejora el uso de las frecuencias. La compatibilidad entre analógico y digital permite la reutilización plena de los recursos existentes. Además, el Hytera BD506 es excepcionalmente sólido para un desempeño adecuado en condiciones difíciles.', 39, '2023-09-07 17:29:04'),
(1822, NULL, 131, 135, 1, 159, 3, '169000', '19', '0', 0, 0, 'Venta de bateria Hytera', 39, '2023-09-07 17:29:04'),
(1823, NULL, 156, 135, 1, 159, 3, '26000', '19', '0', 0, 0, NULL, 39, '2023-09-07 17:29:04'),
(1824, NULL, 546, 135, 1, 159, 3, '295000', '19', '0', 0, 0, 'HYT TC-320 es única por su cuerpo compacto y delicado, excelente calidad de sonido, protección superior contra caídas y diseño ergonómico. Este producto permite a los usuarios disfrutar plenamente de los beneficios de la comunicación en tiempo real a un precio favorable, ideal para entornos comerciales.', 39, '2023-09-07 17:29:04'),
