(84, 46, 181, NULL, 'ACTIVIDADES REALIZADAS EL DIA 03/05/2023 SALIDA DE\nMEDELLÍN-BOLOMBOLO LLEGADA AL POSTE SOSE-01 PARA\nINICIO DE PRUEBAS.\nSE LLEVARON TODAS LAS ELECTRÓNICAS PARA REALIZAR\nPRUEBAS, PRUEBAS CON PRIMERA ELECTRÓNICA CLONADA\nCOMO ELECTRÓNICO SOSE-01 ABRE FONIA NORMAL,\nCOMUNICA CON SISTEMA HORUS.\nSE LLEVARON TODAS LAS ELECTRÓNICAS PARA REALIZAR\nPRUEBAS, PRUEBAS CON SEGUNDA. ELECTRÓNICA\nCLONADA COMO ELECTRÓNICO SOSE-01 ABRE FONIA\nNORMAL, COMUNICA CON SISTEMA HORUS.\nSE PROCEDE A PROBAR LAS ELECTRÓNICAS CLONADAS Y\nCOMUNICAN BIEN EN EL POSTE SOSE-03 SE INSTALA\nELECTRÓNICA SE VERIFICA CABLEADO DE BORNERA X-1.\nSE VERIFICA CABLEADO DE BORNERA X-2 Y BUEN AJUSTE DE\nLAS CONEXIONES.\nPRUEBAS DE COMUNICACIÓN DEL SOSE-03 CON LAS\n\nELECTRÓNICAS YA PROBADAS Y FUNCIONALES EN EL SOSE-\n01 Y LA IP CORRESPONDIENTE AL SOSE-03 FALLIDAS NO\n\nABRE FONIA LLAMADA SE CORTA ANTES DE CONTESTAR.\nSE DESCONECTA FÍSICAMENTE EL SOSE-01 Y DEJARLO\nFUERA DE COMUNICACIÓN PARA SIMULAR EN EL SOSE-03 LA\nIP DEL SOSE-01.\nSE REALIZA CAMBIO EN LA ELECTRÓNICA DEL SOSE-03 EL\n\nCUAL SE LE COLOCO EN EL PASO ANTERIOR LA IP DE SOSE-\n01 Y COMUNICA CORRECTAMENTE.\n\nYA QUE EL SOSE-03 COMUNICA CON LA IP DEL SOSE-01 SE\nPROCEDE A NORMALIZAR LA DIRECCIÓN IP DEL SOSE-03 A LA\nDIRECCIÓN TERMINADA EN .13 SE REALIZAN PRUEBAS Y SON\nFALLIDAS.\nEN CONCLUSIÓN, SE NORMALIZA EL SOSE-01 Y 03 CON SUS\nPARÁMETROS CORRESPONDIENTES Y DIRECCIONES IP.', NULL, '1', '600.000,00', '0,00', '19', '0', '714.000,00'),
