INSERT INTO `history_cotizaciones` (`id`, `cotizacion_id`, `observacion`, `created_by`, `created_at`) VALUES
(5, 2, 'llamar 16 de febrero a la señora carol', 39, '2023-02-15 17:12:39'),
(6, 3, 'Preguntar a la sra carol', 39, '2023-02-15 17:15:36'),
(7, 4, 'llamar a stiven a preguntar la licitación', 39, '2023-02-15 17:17:19'),
(9, 4, '17/02/2022 se hablo con el señor jeferson para saber sobre la licitacion me dice q esta pendiente aprobacion por parte del comite pero los que emviron una propuesta o cotizacion los notifica de igual manera estar pendiente para llamarlo si no envian la licitacion la otra semana', 39, '2023-02-17 09:34:26'),
(10, 3, '17/02/2022 Se hablo con la ingeniera Karol y me informa que ya estan evaluando las propuestas y estan esperando la cotizacion de otro proveedor para revisar si nuestra oferta este dentro del valor comercial', 39, '2023-02-17 11:53:33'),
(11, 2, '17/02/2023  se hablo con la señora carol me dice que con las pruebas que se hizo se esta evaluado por que hay puntos donde no es buena la señal entonces el señor gabriel el quedo con la señora carol que nos enviaria la informacion sobre los puntos donde no hay buena recepcion', 39, '2023-02-17 14:21:48'),
(12, 26, 'se modifico la cotizacion y se puso pago a credito se hablo con el cliente y si la recibio estar pendiente', 39, '2023-03-10 11:22:04'),
(13, 23, 'se hablo con el señor jairo me dice que esta pendiente de aprobación', 39, '2023-03-10 14:22:19'),
(14, 20, 'se hablo con la señora y dice que tuvo una propuesta mejor', 39, '2023-03-10 14:41:56'),
(15, 22, 'Se hablo con la señorita lorena y me dice que ya esta haciendo el comparativo ella nos avisa', 39, '2023-03-10 15:12:23'),
(16, 21, 'Se hablo con la señorita lorena y me dice que ya esta haciendo el comparativo ella nos avisa', 39, '2023-03-10 15:12:41'),
(17, 19, 'se hablo con el señor  juan fernardo y se le ofrecio un descuento para la compra me dijo que lo hiba tener presente pero que por ahora no hinban a realizar la compra', 39, '2023-03-10 15:15:37'),
(18, 28, 'se envia cotizacion via whatsap por solicitud del cliente', 39, '2023-03-10 15:18:16'),
(19, 18, 'se equivocaro en consorcio antioquia al mar en la orden de compra solicitan cambio de referencia por DEP250 se vuelve a cotizar para que envien nuevamente orden de compra', 39, '2023-03-13 09:33:58'),
(20, 31, 'aprobacion la compra de 6 radios tk 3000', 39, '2023-03-14 12:07:47'),
(21, 29, 'esta cotizacion es el cambio de la orden de compra de los dep 450', 39, '2023-03-14 12:10:28'),
(22, 28, 'se le ha escrito a la señora en varias oportunidades recibe el mensaje pero no los contesta', 39, '2023-03-14 12:11:41'),
(23, 26, 'aprobacion de cotizacion', 39, '2023-03-14 12:12:49'),
(24, 25, 'se envia documentos solicitados', 39, '2023-03-14 12:13:18'),
(25, 27, 'se realizo factura fv 3800 y entrega', 39, '2023-03-14 12:19:44'),
(26, 4, 'me comunique de nuevo con el ingeniero jeferson me dice que aun no han montado la licitacion pero que sigamos pendientes', 39, '2023-03-14 12:21:51'),
(27, 26, 'el ingeniero que necesitaba los radios dijo que los tk3000 no le servian por el alcance entonces se volvio hacer cotizacion por unos motorola RVA50 EN UHF le escribi y estan esperando una firma para enviar la nueva orden de compra', 39, '2023-03-17 09:24:01'),
(28, 44, 'Se realizo seguiento con el ingeniero john reginfo me dice que me comunique con el ingeniero efren', 39, '2023-04-19 11:06:10'),
(29, 55, 'Se genero esta cotizacion para sustentar la subida del ipc en facturación', 39, '2023-05-15 11:49:46'),
(30, 58, 'se hablo con la señorita lina y esta pendiente de aprobacion de presupuesto', 39, '2023-06-01 08:36:13'),
(31, 72, 'el cliente nos mamnifesta que no van adquirir los radios por que el cliente de elos no los confirmo', 39, '2023-06-21 11:10:41'),
(32, 40, 'se realizo el seguiento con don alejandro pero dice que no han dado el permiso', 39, '2023-07-28 10:02:39'),
(33, 106, 'llame a la señorita juliana y le indique que le habia enviado ñla cotizacion tambien le escribi por correo', 39, '2023-07-28 10:09:13'),
(34, 106, 'se realizo la entrega de los radios a satisfaccion del cliente e ingreso a facturacion', 39, '2023-07-31 11:15:07'),
(35, 104, 'el 31/07/2023 El señor jose se comunico  y se le informo que ese era el precio del servicio me dice que si lo van a tomar estamos pendiente de que envien la orden de servicio', 39, '2023-07-31 12:03:50'),
(36, 103, 'se escribio al ingeniero por whatsap y se llamo nos informa que aun no aprobado la compra', 39, '2023-07-31 12:14:48'),
(37, 102, 'se envio cotizacion estamos pendiente de aprobacion', 39, '2023-07-31 12:47:15'),
(38, 101, 'se hablo con maria camila que ya estan esperando el director de obra para que apruebe la cotizacion', 39, '2023-07-31 12:53:00'),
(39, 132, 'no se realiza visita tecnic autoriza gerencia al traslado de los equipos por personal de Regency, bajo supervision de nuestros ingenieros', 39, '2023-09-07 12:41:59');
