(1, 'CRM-KPCFMK', 'Estudio RF', 'Realizar estudio de cobertura y búsqueda de sitios de repetición, Simulación etc.', 2, 67, '[12]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:47:53', '2023-03-30 14:44:14'),
(2, 'CRM-RB9ZAQ', 'Diseño de Rack de comunicaciones', 'Realizar un diseño en Visio, Del esquema de conexión de equipos en Rack y antenas, Para determinar el material necesarios en la instalación', 4, 67, '[12]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:49:13', '2023-03-30 14:44:14'),
(3, 'CRM-TWKS2L', 'Solicitud de Elementos', 'De acuerdo al diseño de Racks, Realizar una lista de materiales necesarios para la instalación de equipos', 5, 67, '[12]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:50:07', '2023-03-30 14:44:14'),
(4, 'CRM-9SESFF', 'Elementos Necesarios', 'De acuerdo a la solicitud de elementos solicitados por Jesús, Verificar elementos en existencia en almacén, De los elementos que no hay existencia, Proceder con la cotización, proceso de pago y recogida de los mismos', 8, 67, '[12]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:52:02', '2023-04-04 16:28:21'),
(5, 'CRM-YIXMLK', 'Frecuencias', 'Asignar frecuencias para los 4 sitios de repetición estimados', 1, 67, '[6]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:53:06', '2023-03-30 14:44:14'),
(6, 'CRM-9JRTNP', 'Prueba de equipos', 'Realizar la verificación de los equipos en parámetros de TX, DEV, EF, Recepción Potencia ETC. Configuración y ajuste de duplexores a la frecuencia asignada, Marcación de equipos en su totalidad(Nombre, Ubicación, Parámetros medidos)', 6, 67, '[19]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:55:42', '2023-04-04 16:28:21'),
(7, 'CRM-QHVYHL', 'Armado de Racks', 'Realizar el armado de los equipos en rack, con respectivas protecciones, conexiones, sistema de tierra etc...', 10, 67, '[19,24]', 4, '2023-03-10', NULL, 12, '2023-03-10 17:57:26', '2023-04-04 16:28:21'),
